import React from "react";
import { Row, Col } from "antd";
import LoginForm from "../../components/LoginForm";
import {GlobalContainer, ContentContainer} from "./styles";


const login = () => {
  return (
    <GlobalContainer>
      <ContentContainer>
        <Row>
          <Col xs={24} md={12}>
            <div></div>
          </Col>
          <Col xs={24} md={12}>
            <div></div>
          </Col>
        </Row>
      </ContentContainer>
      <Footer>

      </Footer>
    </GlobalContainer>

    /* <Row gutter={8}>
        <Col xs={24} md={6} />
        <Col xs={24} md={12}>
          <LoginForm />
        </Col>
        <Col xs={24} md={6} />
      </Row> */
  );
};

export default login;
